import { React, useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Header() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const handleLogin = async () => {
    try {
      const formData = new FormData();
      formData.append('username', username);
      formData.append('password', password);

      const response = await fetch('/', {
        method: 'POST',
        body: formData
      });

      if (response.ok) {
        navigate('/profile'); // Перенаправление на страницу профиля
      } else {
        console.error('Ошибка авторизации:', response.status);
      }
    } catch (error) {
      console.error('Ошибка при выполнении запроса:', error);
    }
  };

  // const goToProfile = () => {
  //   navigate('/profile'); // Путь к странице 
  // };
  return (
    <header>
      <div className='heading'>Здоровье в корзине</div>
      <h1 className='heading'>Авторизация</h1>
      <div className='container'>
        <div className='login'>
          <div className='form'>
            <form>
              <input
                type="text"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                placeholder="Имя пользователя"
              />
              <input
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                placeholder="Пароль"
              />
              <button onClick={handleLogin}>
                Войти
              </button>
            </form>
          </div>
        </div>
      </div>
      <div class="navbar">
        <div class="thq-navbar-nav">
          <span>Журавская Е.В.<br></br>Теплякова Ю.Д.</span>
        </div>
      </div>
    </header>
  );
}
